import React from "react";
import backgroundImage from "../public/logo.png"; // Import the image
import "./App.css"; // Ensure this is linked

function App() {
  return (
    <div className="app-container">
      <div
        className="hero-section"
        style={{ backgroundImage: `url(${backgroundImage})` }} // Use imported image here
      >
        <h1 className="main-heading">Bloom well</h1>
        <p className="tagline">
          When things change inside you, things change around you
        </p>
      </div>
    </div>
  );
}

export default App;
